// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.13;

import "./Teacher.sol";

contract Score {
    uint256 _score;

    address sender;
    constructor() {
    }
    //修改学生分数
    function setScore(uint256 score) external isTeacher(msg.sender){
        require(score <= 100, "score must less than 100");
        sender = msg.sender;
        _score = score;
    }

    modifier isTeacher(address teacher) {
        require(teacher == createTeacher(), "only teacher can set score");
        _;
    }

    //creat2构建Teacher合约地址 createTeacher()
    function createTeacher() public view returns (address) {
        bytes32 salt = keccak256(abi.encodePacked(msg.sender));
        return address(uint160(uint256(keccak256(abi.encodePacked(
            hex"ff",
            msg.sender,
            salt,
            keccak256(abi.encodePacked(
                type(Teacher).creationCode
            ))
        )))));

    }

}

interface IScore {
    //修改学生分数
    function setScore(uint256 score) external;
}

